import '../styles/Navbar.css';

function Navbar() {
    return (
        <div className='navbar'>
            <a href="#" className='logo'>4-3-3</a>
            <div className='links'>
                <a className='link'>Home</a>
                <a className='link'>Matches</a>
                <a className='link'>Host a Match</a>
            </div>
        </div>
    );
}

export default Navbar;
